import React, { useState } from "react";
import { data } from "./Data";
import MyAccordian from "./MyAccordian";


const Accordian =()=>{
    const [value,setValue]=useState(data)
    return(
        <><section>
            {
                value.map((curEle)=>{
                    return <MyAccordian key={curEle.id} {...curEle}/>
                })
            }
            </section>
        </>
    ) 
}
export default Accordian
